import React from 'react'
import { registerWithEmailAndPassword } from '../config/functions';


function Authen() {
    const [uName, setUname] = React.useState('');
    const [uPw, setUpw] = React.useState('');
    const [authenMode, setAuthenMode] = React.useState(false);

    const LoginHandle = () =>{
        console.log(uName +"/"+uPw)
        registerWithEmailAndPassword(uName, uPw)
        setUname('')
        setUpw('')
    }

    const SwitchAuthen = () => setAuthenMode(!authenMode)
  return (
    <div className='container-fluid'>
         {authenMode ? 
        <div className='authen-form mt-10 md:mt-20 form m-auto w-full md:w-1/5'>
        <h3 className='text-3xl font-bold'>Welcome back</h3>
        <input className='w-full rounded-md' name='email' placeholder='Email' value={uName} onChange={(e) => setUname(e.target.value)} />
        <input className='w-full rounded-md' name='password' placeholder='Password' onChange={(e) => setUpw(e.target.value)} />
        <button className='btn w-full rounded-md bg-cyan-500 p-2 text-white' onClick={LoginHandle}>Login</button>
        <button className='btn w-full rounded-md bg- p-2 text-white' onClick={SwitchAuthen}>Join Now</button>
        </div>
        :
        <div className='authen-form mt-10 md:mt-20 form m-auto w-full md:w-1/5'>
        <h3 className='text-3xl font-bold'>Join now</h3>
        <input className='w-full rounbded-md' name='email' placeholder='Email' value={uName} onChange={(e) => setUname(e.target.value)} />
        <input className='w-full' name='password' placeholder='Password' onChange={(e) => setUpw(e.target.value)} />
        <button className='btn w-full' onClick={LoginHandle}>Go</button>
        <button className='btn w-full' onClick={SwitchAuthen}>Login</button>
        </div>
        }
    </div>
  )
}

export default Authen
